  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0116645 includes chemical,
  discrete sample, physical and profile data collected from POLARSTERN in the South
  Atlantic Ocean from 1989-09-06 to 1989-10-30 and retrieved during cruise ANTVIII_2.
  These data include DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE,
  SALINITY, SILICATE and WATER TEMPERATURE. The instruments used to collect these
  data include CTD and bottle. These data were collected by Eberhard Fahrbach of Alfred
  Wegener Institute for Polar and Marine Research as part of the ANTVIII_2 data set.nnThe
  International CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries
  out a systematic and global re-occupation of select WOCE/JGOFS hydrographic sections
  to quantify changes in storage and transport of heat, fresh water, carbon dioxide
  (CO2), and related parameters.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
